import "./Main.css";

function Main(): JSX.Element {


    return (
        <div className="Main">  
        <Card sx={{ m: 5 }}>

                <Typography sx={{mt: 5}}>הזן מספר טלפון לבדיקה</Typography>

            <CardContent>
        <TextField fullWidth  
         variant="outlined" />

        <Button variant="contained" color="warning"> בדיקה במאגר</Button>
        </CardContent>
        </Card>
        </div>
    );
}

export default Main;
